import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import { Container} from 'react-bootstrap'

function App() {
  return (
    <div className="App">
      <Container></Container>
      <Header />
      <h2>Welcome to Spinworld</h2>
      <Footer />
    </div>
  );
}

export default App;
